import React, { PureComponent } from "react";
import {
  BarChart,
  Bar,
  Brush,
  ReferenceLine,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
} from "recharts";

const data = [
  { name: "1", uv: 300, pv: 456, ac: 800 },
  { name: "2", uv: -145, pv: 230, ac: 800 },
  { name: "3", uv: -100, pv: 345, ac: 800 },
  { name: "4", uv: -8, pv: 450, ac: 800 },
  { name: "5", uv: 100, pv: 321, ac: 800 },
  { name: "6", uv: 9, pv: 235, ac: 800 },
  { name: "7", uv: 53, pv: 267, ac: 800 },
  { name: "8", uv: 252, pv: -378, ac: 800 },
  { name: "9", uv: 79, pv: -210, ac: 800 },
  { name: "10", uv: 294, pv: -23, ac: 800 },
  { name: "12", uv: 43, pv: 45, ac: 800 },
  { name: "13", uv: -74, pv: 90, ac: 800 },
  { name: "14", uv: -71, pv: 130, ac: 800 },
  { name: "15", uv: -117, pv: 11, ac: 800 },
  { name: "16", uv: -186, pv: 107, ac: 800 },
  { name: "17", uv: -16, pv: 926, ac: 800 },
  { name: "18", uv: -125, pv: 653, ac: 800 },
];

export default class Example extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/mc8r7e6p/";

  render() {
    return (
      <BarChart
        width={500}
        height={300}
        data={data}
        margin={{
          top: 5,
          right: 30,
          left: 20,
          bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend verticalAlign="top" wrapperStyle={{ lineHeight: "40px" }} />
        <ReferenceLine y={0} stroke="#000" />
        <Brush dataKey="name" height={30} stroke="#8884d8" />
        <Bar dataKey="pv" fill="#8884d8" />
        <Bar dataKey="uv" fill="#82ca9d" />
        <Bar dataKey="ac" fill="#82ca9d" />
      </BarChart>
    );
  }
}
